import './Grid.css';
import NumberSquare from './NumberSquare';

const Grid = (props) => {

    let status = props.start
    let size = props.size

    const arr = [];

    for (let i = 2; i < size; i++) {
        arr.push(i);
    }

    return (
        <div className="Grid">


            {arr.map((item, index) => <NumberSquare number={item} />)}
        </div>
    )

}

export default Grid;
